import React from 'react'
import { BrowserRouter } from 'react-router-dom'
import Badges from '../pages/Badges'
import BadgeNew from '../pages/BadgeNew'

function App() {
    return (
        <BrowserRouter>
            <Router path="/badges " component={Badges} />
            <Router path="/badges/new " component={BadgeNew} />          
        </BrowserRouter>
    )
}

export default App
